import React from 'react';
import {Accordion, Card, Button} from 'react-bootstrap';
import CardsContentJSON from './sCards.json';
const jsonArr = JSON.stringify(CardsContentJSON.CardsContent);
class clServices extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Card>
                <Card.Header>
                    <Accordion.Toggle as={Button} variant="link" eventKey={this.props.keyNum}>
                        {jsonArr.split('"')[`{cntNum}`]}
                    </Accordion.Toggle>
                </Card.Header>
                <Accordion.Collapse eventKey={this.props.keyNum}>
                    <Card.Body>{jsonArr.split('"')[`{cntNum+2}`]}</Card.Body>
                </Accordion.Collapse>
            </Card>
        );
    }
}


export default clServices;
